FeedPackage.ReleaseNotes:
This release contains some bug fixes as well as a few revised extension methods. The following work was completed for this release:
- New extensions for Type: GetDefaultValue - New extensions for IEnumerable{string}: IsSequenceOf{T}
- Refactors for String: SanitizeXmlElementName --> SanitizeElementText

This release contains a complimentary extension method.
The following work was completed for this release:

- New extensions for IEnumerable{T}: ToPagedCollection{T}

This release contains some complimentary extension methods.
The following work was completed for this release:

- New extensions for {T}: ParseWith{T}
- New extensions for IEnumerable{T}: ParseSequenceWith{T}

- Removed the Transform extension method because of the redundancy to the ParseWith extension method
- Removed the TransformSequence extension method because of the redundancy to the ParseSequenceWith extension method

This release contains some complimentary extension methods.
