This release contains some complimentary extension methods and removal of existing extensions. The following work was completed for this release:
- New extensions for IEnumerable{T}: RandomOrDefault{T}
- Removed the HasCircularReference extension due to noise; please use the ReflectionUtility.HasCircularReference<T> in the Cuemon.Reflection namespace instead - Removed the ChangeType extension due to noise; please use the ConvertUtility.ChangeType in the Cuemon namespace instead - Removed the HasXmlSerializationAttributes extension due to noise; please use the XmlSerializationUtility.ContainsXmlSerializationAttributes in the Cuemon.Xml.Serialization namespace instead - Removed the WhileIsNotNull extension due to noise; please use the HierarchyUtility.WhileSourceTraversalIsNotNull in the Cuemon namespace instead - Removed the WhileSequenceHasElements extension due to noise; please use the HierarchyUtility.WhileSourceTraversalHasElements in the Cuemon namespace instead

This release contains some complimentary extension methods.
The following work was completed for this release:

- New extensions for DateTime: Floor, Ceiling, Round
- New extensions for IEnumerable{KeyValuePair{TKey, TValue}}: ToDictionary{TKey, TValue}

- Renamed the ToEnumerable{T} extension to Yield{T}

This release contains some complimentary extension methods and removal of earlier.
