- New extensions for String: ToEnum{TEnum}
- New extensions for {TResult}: DynamicWrap{TResult}

- Removed Add, And, Assign, Divide, ExclusiveOr, LeftShift, Multiply, Or, Remainder, RightShift and Subtract extensions due to noise. Please use the AssignmentUtility directly from the Cuemon namespace instead

